import React from "react";
import { useParams } from "react-router-dom";

function SchedulePage() {
  const { rows, param2 } = useParams();
  const params = useParams;
  console.log("SCHED PARAMETERS ARE")
  console.log(params)
  const parsedRows = JSON.parse(rows || "[]"); // Use an empty array as the default value

  return (
    <div>
      <h1>Your Schedule</h1>
      <h2> {param2} </h2>
      <table>
        <thead>
          <tr>
            <th>Time</th>
            <th>Task</th>
            <th>Goal</th>
          </tr>
        </thead>
        <tbody>
          {parsedRows.map((row, index) => (
            <tr key={index}>
              <td>{row.time}</td>
              <td>{row.task}</td>
              <td>{row.goal}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default SchedulePage;
